    for (var j = 0; j < election_results.races.length; j++) {
        x = election_results.races[j].state;
        if (x == regions[i].data('region')) {
            regions[i].mouseover(function(e) {
                this.node.style.fill = 'red';
                this.node.style.opacity = 0.7;
                document.getElementById('region-name').innerHTML = this.data('region');
                for (var k = 0; k < stateTotals.states.length; k++) {
                    if (this.data('region') == stateTotals.states[k].name) {
                        if ((election_results.races[k+1].ahead - stateTotals.states[k].disenfranchised) < 0){
                            this.node.style.fill = 'purple';
                        }
                        document.getElementById("demo").innerHTML =
                            "Disenfranchised : " + stateTotals.states[k].disenfranchised + "<br>" +
                            "Disenfranchised Black: " + stateTotals.states[k].disenfranchisedBlack + " <br><br>" +
                            "Margin: " + election_results.races[k+1].ahead + " <br><br>" +
                            "Flippable: " + " " + (election_results.races[k+1].ahead - stateTotals.states[k].disenfranchised);
                    }
                }
            });


            regions[i].mouseout(function(e) {
                this.node.style.opacity = 1;
                this.node.style.fill = '#D3D3D3';
            });
        }

    }

    // Showing off


    regions[i].mouseout(function(e) {
        this.node.style.opacity = 1;
        document.getElementById("demo").innerHTML = ""
    });
